      console.log(itens[i].latitude);
      marker = new window.google.maps.Marker({
          position : new window.google.maps.LatLng(
              itens[i].latitude,
              itens[i].longitude
          ),
          map : map
      });

      window.google.maps.event.addListener(
          marker,
          "click",
          (function(marker, i) {
              return function () {
                  infoWindow.setContent(itens[i].id);
                  infoWindow.open(map, marker);
              };
